  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Bison
  Range outlines Refuge accomplishments from January through April of 1944. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, and mammals- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. The public relations section
  of the report describes recreational uses, Refuge visitors, and Refuge participation.
  N-R forms, a summary of the previous year, and photographs are attached.\",\n\t\"owner_org\":
